import React from 'react';
import styled from 'styled-components';
import { Container, Col, Row } from 'react-grid-system';




interface Props {}

const Landing: React.FunctionComponent<Props> = () => {

  return (
    <>
    <Container>
      <MainWrapper>
      <div className="top">
        <a href="/">Logo</a>
        <div className="box-top-right-border">box1</div>
        </div>
      <div className="mid">
        <div className="main-text">
          <div>Puskal</div>
          <div>Design</div>
        </div>
      </div>
      <div className="bottom">
      <div className="box-bottom-left-border">box2</div>
      </div>
      </MainWrapper>
    </Container>
    </>
  );
};

const MainWrapper = styled.main`
height:100vh;
display:flex;
flex-direction:column;
&>div{
  display:flex;
  justify-content:space-between;
  &.mid{
    align-items:center;
  }
}
`;


export default Landing;
